<template>
<div class="home_container">
    <div class="tweet_container">
        <main_tweet/>
    </div>

    <img :src="previewImage" class="uploading-image"/>
    <input type="file" @change=uploadImage>


    <img :src="data" class="uploading-image"/>
    <button @click="testbtn">test</button>

    <div class="timeline" v-if="timeline_elements != 2002">
        timeline elements
        <div v-for="tweet in timeline_elements">
            {{ tweet.user_id }}
            {{ tweet.tweet_id }}
            {{ tweet.name }}
            {{ tweet.username }}
            {{ tweet.time_created }}
            {{ tweet.body }}
            =====================================================================
        </div>
    </div> 
    <div class="timeline" v-else>
        user follows noone recommend users for user
    </div>
</div>
</template>

<script>
import main_tweet from '@/components/main/main_tweet.vue'

import { timeline_request } from '@/requests'

export default {
    components: {
        main_tweet
    },

    data() {
        return {
            timeline_elements: [],
            selected_file: null,
            previewImage: null,
            testImage: null,
            data: "data:image/png;base64,"
        }
    },

    async beforeCreate() {
        let response_value = await timeline_request()
        this.timeline_elements = response_value.response
    },

    methods: {
        uploadImage(e){
            const image = e.target.files[0];
            const reader = new FileReader();
            reader.readAsDataURL(image);
            reader.onload = e =>{
                this.previewImage = e.target.result;
                console.log(this.previewImage);
            }
        },
    }
}

</script>

